#
# TABLE STRUCTURE FOR: delivery_assign
#

DROP TABLE IF EXISTS `delivery_assign`;

CREATE TABLE `delivery_assign` (
  `delivery_id` int(11) NOT NULL AUTO_INCREMENT,
