  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: shipping_info
#

DROP TABLE IF EXISTS `shipping_info`;

CREATE TABLE `shipping_info` (
