  PRIMARY KEY (`method_id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: shipping_order_errors
#

DROP TABLE IF EXISTS `shipping_order_errors`;

CREATE TABLE `shipping_order_errors` (
  `order_id` varchar(50) NOT NULL,
  `messsage` text DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT current_timestamp()
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# TABLE STRUCTURE FOR: shipping_orders
#

DROP TABLE IF EXISTS `shipping_orders`;

